import React from "react";
//import { useState } from "react";
import { useNavigate } from "react-router-dom";
import { useEffect, useState } from "react";
const Home = () => {
  const [fileinfo, setFileinfo] = useState([]);
  const [data, setData] = useState([]);
  //const navigate = useNavigate();
  var requestOptions = {
    method: "GET",
    redirect: "follow",
  };
  const fetchData = () => {
    fetch(`http://localhost:1337/api/fileinfos`)//http://localhost:1337/api/fileinfos//https://dummyjson.com/products
      .then((response) => response.json())
      .then((actualData) => {
        console.log(actualData);
        setData(actualData.products);
        console.log(data);
      })
      .catch((err) => {
        console.log(err.message);
      });
  };

  useEffect(() => {
    fetchData();
  }, []);
  //-----------------------
  let fetchdcndata = async () => {
    try {
      let dcnfile = await fetch(
        "http://localhost:1337/api/fileinfos",
        requestOptions
      ).then((x) => x.json());

      console.log(dcnfile.data);
      alert(dcnfile.data[0].attributes);
      return await dcnfile;
    } catch (error) {
      console.log(error);
    }
  };//let testdata= {fileID: 'first file ID ', cid: 'bafybeiacs6qaawbgrwq26zzno2lpoor3nzzmjyo5b4f2ejbjfdp5n2of74', name: 'file3.json', type: 'invest', createdAt: '2023-01-26T15:10:02.581Z'}
  return (
    <div>
      <h1>welcome to home page </h1>
      <div className="button-container">
        <input onClick={fetchdcndata} type="submit" />
      </div>
      <tbody>
        <tr>
          <th>fileID</th>
          <th>CID</th>
         
          <th>name</th>
          <th>type</th>
        </tr>
        {data.map((item, index) => (
          <tr key={index}>
            <td>{item?.attributes?.fileID}</td>
            <td>{item.cid}</td>
            <td>
              {/* <img src={item.thumbnail} alt="" height={100} /> */}
            </td>
            <td>{item?.attributes?.fileID}</td>
            <td>{item?.attributes?.fileID}</td>
          </tr>
        ))}
      </tbody>
    </div>
  );
};
 export default Home;
